import React, { Component } from 'react';
import { Container, Jumbotron, ListGroup, Form, ButtonToolbar, Button, Row, Col, FormLabel} from 'react-bootstrap';
import   './style.css';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import DeliveryCost from '../DeliveryCost/DeliveryCost';
import PossibleRoutes from '../PossibleRoutes/PossibleRoutes';
class NewLayout extends Component {

render(){
    return (
        <div className="layout">

            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/users">Users</Link>
                </li>
                <li>
                    <Link to="/contact">Contact</Link>
                </li>
            </ul>
            <Route exact path="/" component={App} />
            <Route path="/users" component={DeliveryCost} />
            <Route path="/contact" component={PossibleRoutes} />


        </div>
    )
}
}

export default NewLayout;



